import React, {useState} from "react";
import { Page, Text, PDFViewer , Document} from '@react-pdf/renderer';


function LectionPage(){
  const [numPage, SetNumPage] = useState(null)
  const [numNumber, SetNumNumber] = useState(1)

  function onDocumentLoadSuccess({numPage}){
    SetNumPage(numPage);
    SetNumNumber(1);
  };

  return(
    <PDFViewer style={{ width: '100%', height: '100vh' }}>
      <Document file="/data/lecture/lecture_1/Лекция 1.pdf">
        <Page size="A4">
          <Text>Привет, это PDF</Text>
        </Page>
      </Document>
    </PDFViewer>
  );
}

export default LectionPage;
